import { useState, Fragment } from "react";

function App() {
	const [count, setCount] = useState(0);

	const handleIncrement = () => {
		setCount(() => count + 1);
	};
	const handleDecrement = () => {
		setCount(() => count - 1);
	};
	return (
		<Fragment>
			{count}
			<button onClick={handleIncrement}>+</button>
			<button onClick={handleDecrement}>-</button>
			<Link href="/about">
				<a>About </a>
			</Link>
		</Fragment>
	);
}
export default App;
